import React from 'react';
import { Outlet, NavLink } from 'react-router-dom';
import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import NavDropdown from 'react-bootstrap/NavDropdown';

export default function Index() {
  return (
    <>
      <Navbar className="navbar-custom" variant="dark" expand="lg">
        <Container>
          <Navbar.Brand className="navbar-brand-gradient" href="/">My Site</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="me-auto">
              <Nav.Link as={NavLink} to="/" exact className="nav-link-custom">
                Home
              </Nav.Link>
              <Nav.Link as={NavLink} to="/about" className="nav-link-custom">
                About
              </Nav.Link>
              <Nav.Link as={NavLink} to="/music" className="nav-link-custom">
                Music
              </Nav.Link>
              <Nav.Link as={NavLink} to="/contact" className="nav-link-custom">
                Contact
              </Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
      <Outlet />
    </>
  );
}
